column8:
洗練されたデザインと美しい発色で、耐久性にも優れ、遊び毛も出にくいループタイプの階段マットです。お手入れもサッと拭くだけの簡単さ。階段空間を優雅に彩ります。優しい踏み心地で、足や腰への負担を緩和、裏面にズレ防止の両面テープ付き。<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">洗練されたデザインと美しい発色で、耐久性にも優れ、遊び毛も出にくいループタイプの階段マットです。お手入れもサッと拭くだけの簡単さ。階段空間を優雅に彩ります。優しい踏み心地で、足や腰への負担を緩和、裏面にズレ防止の両面テープ付き。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">65×21×折り曲げ幅4cm、パイル長さ:ループ約3mm</font><br><font color="#333333" size="-1">個装サイズ：67×33×31cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">1枚あたり:0.3kg</font><br><font color="#333333" size="-1">個装重量：4200g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">表面:ポリエステル100％、裏面:天然ラテックス(両面テープ付)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">取扱説明書</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>Tel 050-1040-7307</font><style type="text/css">
