特殊技術により生まれたオレフィン樹脂100％からなるズレ防止テープです。表面強度が強く、耐久性に優れています。マットに貼り付けることでお掃除などの移動も楽にできます。マットやカーペットの裏面の4辺と中心部分に貼ることで効果を発揮します。抗菌・防カビ配合。<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">特殊技術により生まれたオレフィン樹脂100％からなるズレ防止テープです。表面強度が強く、耐久性に優れています。マットに貼り付けることでお掃除などの移動も楽にできます。マットやカーペットの裏面の4辺と中心部分に貼ることで効果を発揮します。抗菌・防カビ配合。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">10cm×4m</font><br><font color="#333333" size="-1">個装サイズ：2×15×26cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：120g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">表面:オレフィン樹脂(ポリエチレン系)<br>裏面:オレフィンフィルム<br>粘着層:アクリル系樹脂<br>剥離紙:紙</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>Tel 050-1040-7307</font><style type="text/css">
